function get_uptimerobot_widget_data(){jQuery.ajax({method:"GET",url:uptimerobot.data_url,dataType:"json",timeout:uptimerobot.timeout,success:function(t){jQuery("#uptimerobot").html(t.data)},error:function(){jQuery("#uptimerobot").html(uptimerobot.error)}})}jQuery(document).ready(function(t){t.ajax({method:"GET",url:uptimerobot.cache_data_url,dataType:"json",timeout:uptimerobot.timeout,success:function(e){e&&t("#uptimerobot").html(e.data)},complete:function(){get_uptimerobot_widget_data(),setInterval(function(){get_uptimerobot_widget_data()},3e5)}})});